  true,\n\t\"url\": null,\n\t\"notes\": \"<p>1995-2016. Centers for Disease Control
  and Prevention (CDC). State Tobacco Activities Tracking and Evaluation (STATE) System.
  Legislationu00e2u0080u0094Youth Access. The STATE System houses current and historical
  state-level legislative data on tobacco use prevention and control policies.  Data
  are reported on a quarterly basis. Data include information related to restrictions,
  enforcement and penalties associated with the sale of cigarettes to youth through
  retail sales and vending machines.</p>n\",\n\t\"license_title\": \"Other License
